import React from "react";
import DiaryItem from "../DiaryItem/DiaryItem";

const DiaryList = ({ diaryList }) => {
  return (
    <>
      <h2>일기 리스트</h2>
      <div>{diaryList.length}개의 일기가 있습니다.</div>
      {diaryList.map((data) => (
        <DiaryItem key={data.id} {...data} />
      ))}
    </>
  );
};

export default DiaryList;
